import React, { useState } from 'react';

function HomePage() {
  const [activeTab, setActiveTab] = useState('overview');

  return (
    <div className="flex flex-col min-h-screen bg-gray-100">
      {/* Header */}
      <header className="bg-indigo-600 p-4 text-white">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-2xl font-bold">Customer Portal</h1>
          <div>
            <button className="px-4 py-2 bg-indigo-800 hover:bg-indigo-900 rounded">Help Center</button>
            <button className="ml-4 px-4 py-2 bg-indigo-800 hover:bg-indigo-900 rounded">Settings</button>
          </div>
        </div>
      </header>

      {/* Tabs */}
      <div className="container mx-auto p-4">
        <div className="bg-white p-4 rounded-lg shadow-md mb-6">
          <div className="flex space-x-2 justify-center">
            {['overview', 'services', 'support'].map((tab) => (
              <button
                key={tab}
                className={`px-4 py-2 rounded-lg ${activeTab === tab ? 'bg-indigo-600 text-white' : 'bg-gray-200 text-gray-600'}`}
                onClick={() => setActiveTab(tab)}
              >
                {tab.charAt(0).toUpperCase() + tab.slice(1)}
              </button>
            ))}
          </div>
        </div>

        {/* Tab Content */}
        {activeTab === 'overview' && (
          <div className="bg-white p-4 rounded-lg shadow-md">
            <h2 className="text-xl font-bold mb-4">Overview</h2>
            <p className="text-gray-600">You have made 5 transactions this month.</p>
          </div>
        )}

        {activeTab === 'services' && (
          <div className="bg-white p-4 rounded-lg shadow-md">
            <h2 className="text-xl font-bold mb-4">Active Services</h2>
            <p className="text-gray-600">2 services active, 1 expiring soon.</p>
          </div>
        )}

        {activeTab === 'support' && (
          <div className="bg-white p-4 rounded-lg shadow-md">
            <h2 className="text-xl font-bold mb-4">Support</h2>
            <p className="text-gray-600">1 ticket needs attention.</p>
          </div>
        )}
      </div>

      {/* Footer */}
      <footer className="bg-indigo-600 text-white p-4 text-center">
        Done by the Risk Rangers: Mpho Ndlela, Alec Cowan, Lucian Young, Anele Siwela
      </footer>
    </div>
  );
}

export default HomePage;
